import { useEffect, useState } from "react";
import axios from "axios";

export default function Order() {

    const [order, setOrder] = useState('');

    useEffect(()=>{
        axios
        .get(`/getOrder`)
        .then((response) => {
          console.log(response.data);
          setOrder(response.data)
        })
        .catch((error) => {
          console.error("Error get order from cart:", error);
        });
    },[])

  return (
    <div className="contaienr-fluid">
  <table className="table">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">Mã đơn hàng</th>
      <th scope="col">Thời gian đặt</th>
      <th scope="col">Trạng thái</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <th scope="row">1</th>
      <td>Mark</td>
      <td>Otto</td>
      <td>@mdo</td>
    </tr>
    <tr>
      <th scope="row">2</th>
      <td>Jacob</td>
      <td>Thornton</td>
      <td>@fat</td>
    </tr>
    <tr>
      <th scope="row">3</th>
      <td>Larry</td>
      <td>the Bird</td>
      <td>@twitter</td>
    </tr>
  </tbody>
</table>

</div>
  );
}
